// Dashboard.js

import React from 'react';
import NavBarCommon from '../../components/NavBarCommon';
import Stack from 'react-bootstrap/Stack';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import './Dashboard.css';

export default function Dashboard() {
  return (
    <div>
      <NavBarCommon />

      <div className="card-container">
        {/* First Row */}
        <Row className="first-row">
          <Col md={8}>
            <Card className="card" style={{ width: '100%' }}>
              {/* Your content for the first card */}
            </Card>
          </Col>
        </Row>

        {/* Second Row */}
        <Row className="second-row">
          <Col md={4}>
            <Card className="card" style={{ width: '100%' }}>
              {/* Your content for the second card */}
            </Card>
          </Col>
          <Col md={4}>
            <Card className="card" style={{ width: '100%' }}>
              {/* Your content for the third card */}
            </Card>
          </Col>
          <Col md={4}>
            <Card className="card" style={{ width: '100%' }}>
              {/* Your content for the fourth card */}
            </Card>
          </Col>
        </Row>

        {/* Third Row */}
        <Row className="third-row">
          <Col md={4}>
            <Card className="card" style={{ width: '100%' }}>
              {/* Your content for the fifth card */}
            </Card>
          </Col>
        </Row>

        {/* Fourth Row */}
        <Row className="fourth-row">
          <Col md={8}>
            <Card className="card merged-card">
              {/* Your content for the merged card */}
            </Card>
          </Col>
        </Row>
      </div>
    </div>
  );
}
